import React from 'react';
import { Router } from '@reach/router';
import logo from './logo.svg';
import './App.css';

const App = () => (
  <div>
    <Router>
      <Home path="/" />
      <LoginController path="/login" />
      <Register path="/register" />
      <Form path="form" />
      <UserStatus path="user-status" />
      <ApproveRequests path="approve-requests" />
      <Deed path="/deed/:id" />
    </Router>
  </div>
);

export default App;
